1-a. Magasin Trévi inc. établira la cédule des travaux, soit du 30 septembre au 1er novembre et du 15 avril au 5 mai
   b. Magasin Trévi inc. n’assume aucune responsabilité pour tous bris, dommage ou détérioration de la piscine dû à un hivernage (après le 1er novembre) ou ouverture (après le 1 juin) tardive.

2 - Les frais de service ne comprennent pas :
le coût des pièces qui doivent être remplacées;
le coût du démontage de la base du tremplin, de la pompe, de la glissoire;
le coût des réparations de la céramique et à la structure de béton après la période
le coût du pompage du trop-plein d’eau lorsque la piscine est hivernée;
le coût du ramassage des feuilles dans la piscine (35.00 $ par sac)

3 - Tout remplissage d’eau requis à l’ouverture devra être effectué par le client.
